measurements.description:
Approximately two thousand eight hundred seventy-five flowers and 345 buds on 23 arching inflorescences up to 50cm distributed completely around plant; 
plant pristine, diameter 150cm, height above pot 90cm, circumference 500cm, grown in bark in a 40-cm diameter plastic pot; 
sepals and petals semi-porrect, ivory; 
lip ivory spotted dark purple, keels yellow;
 anther cap ivory; 
substance average; texture matte.
